import React from "react";
import Layout from "../components/Layout";
import ProjectText from "./content/ProjectText";

const blog = () => {
  return (
    <Layout>
     <div >
      <div >
        <ProjectText />

      </div>
      <div >
        <img src={require("../images/projects/ncnews.png")}/>
      </div>
    </div>
    </Layout>
  );
};

export default blog;
